

var map = new Map();
var choosers = new Choosers();

var tileImage = new Image();
tileImage.src = '/images/bottom.png';//'https://raw.github.com/CS-3450-Software-Engineering/class_documents/master/other_documents/bottom.png';
tileImage.onload = function() {
	map.setTileImage(tileImage);
	choosers.makeChoosers(map.getTileSize());
	choosers.bindChooserEvents();
};

$('#mapPreview').attr('src',"data:image/png;base64,");

function backToMain() {
	$('#load-stuff-here').load('main.html');
	fag = "main";
}

function save() {
	$.post('/map', {map: map.getMap(), mapImage: map.getImage()}, function(data) {
		console.log(data);
	});
}

function previewMap() {
	$('#mapPreview').attr('src', map.getImage());
}
